// components/Projects.js

import React from 'react';

const Projects = () => {
  return (
    <div>
      <h1>Projects</h1>
      <ul>
        <li>Project 1</li>
        <li>Project 2</li>
        <li>Project 3</li>
      </ul>
    </div>
  );
};

export default Projects;
